import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  const handleClick = (event) => {
    event.preventDefault();
    console.log('Clicked on:', event.target.textContent);
  };

  return (
  
    <nav className="navbar">
      <ul className="nav-links">

        <li><Link className="active" to="/home" onClick={handleClick}>Home</Link></li>
        <li><Link to="/product" onClick={handleClick}>Product</Link></li>
        <li><Link to="/review" onClick={handleClick}>Review</Link></li>
        <li><Link to="/wishlist" onClick={handleClick}>Wishlist</Link></li>
        <li><Link to="/create-account" onClick={handleClick}>Create account</Link></li>
        <li><Link to="/order" onClick={handleClick}>Order</Link></li>
      </ul>
    </nav>
  );
}

export default Navbar;



<nav class="navbar navbar-expand-lg navbar-light bg-light">
  <a class="navbar-brand" href="#">Navbar</a>
  <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
    <span class="navbar-toggler-icon"></span>
  </button>

  <div class="collapse navbar-collapse" id="navbarSupportedContent">
    <ul class="navbar-nav mr-auto">
      <li class="nav-item active">
        <a class="nav-link" href="#">Home <span class="sr-only">(current)</span></a>
      </li>
      <li class="nav-item">
        <a class="nav-link" href="#">Link</a>
      </li>
      <li class="nav-item dropdown">
        
      </li>
      <li class="nav-item">
        <a class="nav-link disabled" href="#">Disabled</a>
      </li>
    </ul>
    
  </div>
</nav>
